import React,{component, Component} from 'react';
import "./toolbar.css"

class Toolbar extends Component{

    render(){
        return(
            <div className="top">
                <button className="btn btn-secondary btn-lg ">Home</button>
                <button className="btn btn-secondary btn-lg active">Todos</button>
                <button className="btn btn-secondary btn-lg active">Login</button>
            </div>
        )
    }


}

export default Toolbar;
